  \"2016-03-17T20:52:17.647350\",\n\t\"name\": \"solid-waste-permitted-facilities-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Iowans generate 2.8 million tons of solid
  waste per year. Properly managing those waste streams is critical to protecting
  Iowa's land, water and air resources.  The Department of Natural resources regulates
  the construction, operation and closure of facilities and projects that manage,
  process and dispose solid waste.  This resource provides documents related to permitted
  facilities, such as landfills, transfer stations, material recovery stations, recycling
  facilities, storage facilities, and incinerators.\",\n\t\"license_title\": \"License
